// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract FundsManager {
    address public superAdmin;
    address public withdrawalPerson;
    uint256 public withdrawalLimit;

    constructor(address _withdrawalPerson, uint256 _withdrawalLimit) {
        superAdmin = msg.sender;
        withdrawalPerson = _withdrawalPerson;
        withdrawalLimit = _withdrawalLimit;
    }

    // Function to deposit funds to the contract
    function depositFunds() public payable {
        require(msg.value > 0, "Deposit amount must be greater than zero");
    }

    // Function to get the balance of the contract
    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }

    // Function to withdraw funds, only the superAdmin can withdraw the entire balance
    function withdrawAll() public {
        require(msg.sender == superAdmin, "Only superAdmin can withdraw the entire balance");
        payable(superAdmin).transfer(address(this).balance);
    }

    // Function to withdraw the limit amount and reset the limit to zero
    function withdrawWithLimit() public {
        require(msg.sender == withdrawalPerson, "Only withdrawalPerson can withdraw funds");
        require(withdrawalLimit <= address(this).balance, "Insufficient balance in contract");
        uint256 amount = withdrawalLimit;
        withdrawalLimit = 0;
        payable(withdrawalPerson).transfer(amount);
    }

    // Function to set a new withdrawal limit, only the superAdmin can set it
    function setWithdrawalLimit(uint256 newLimit) public {
        require(msg.sender == superAdmin, "Only superAdmin can set the withdrawal limit");
        withdrawalLimit = newLimit;
    }

    // Function to change the withdrawalPerson, only the superAdmin can change it
    function changeWithdrawalPerson(address newPerson) public {
        require(msg.sender == superAdmin, "Only superAdmin can change the withdrawalPerson");
        withdrawalPerson = newPerson;
    }

    // Function to get the withdrawal limit
    function getWithdrawalLimit() public view returns (uint256) {
        return withdrawalLimit;
    }
}

